import React from 'react';
import * as ReactDOM from "react-dom";
import { Grid } from 'react-bootstrap';

class Body extends React.Component {

      render() {
        return (
<>
<Grid>
      <Row>
        <Col xs={12} md={6}>
          <Tile size="large">Tile 1</Tile>
        </Col>
        <Col xs={12} md={6}>
          <Tile size="large">Tile 2</Tile>
        </Col>
      </Row>
      <Row>
        <Col xs={12} md={6}>
          <Tile size="large">Tile 3</Tile>
        </Col>
        <Col xs={12} md={6}>
          <Tile size="large">Tile 4</Tile>
        </Col>
      </Row>
    </Grid>
</>
    );
}
}
export default Body;
